import React from "react";

const Block = ({ a }) => {
    return (
        <div className="m-10 text-stone-200 text-3xl border-2 border-slate-300 p-5 flex">
            <ul>
                <li>Test id: {a[0]}</li>
                <li>Test number: {a[1]}</li>
                <li>Test string: {a[2]}</li>
                <li>
                    Test img:{" "}
                    <img
                        src={a[3]}
                        alt=""
                        className="w-[100px] h-[100px] inline-block"
                    />
                </li>
            </ul>

            <ul>
                <li>Test id: {a[0]}</li>
                <li>
                    Test img:{" "}
                    <img
                        src={a[4]}
                        alt=""
                        className="w-[100px] h-[100px] inline-block"
                    />
                </li>
            </ul>
        </div>
    );
};

export default Block;
